import React from "react";
import "../index.css";
import Logo from "../Images/Logo.svg";
import {Links} from "../data";

import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Button from "react-bootstrap/Button";
import {Col, NavDropdown} from "react-bootstrap";
import {Form} from "react-bootstrap";

const NavbarOne = () => {
  return (
    <Navbar bg='light' expand='lg'>
      <Container fluid>
        <Col md={3}>
          <Navbar.Brand href='/'>
            <img src={Logo} alt='Meeco' width={200} />
          </Navbar.Brand>
        </Col>

        <Navbar.Toggle aria-controls='navbarScroll' />
        <Navbar.Collapse id='navbarScroll'>
          <Col md={6}>
            <Nav
              className='justify-content-center my-2 my-lg-0'
              style={{maxHeight: "100px"}}
              navbarScroll
            >
              {Links.map(({name, path}, index) => {
                return (
                  <li key={index}>
                    <Nav.Link
                      style={{fontWeight: 500, fontSize: 18}}
                      className='justify-content-center px-3'
                      href={path}
                    >
                      {name}
                    </Nav.Link>
                  </li>
                );
              })}
            </Nav>
          </Col>

          <Col md={3}>
            <Button
              variant='outiline-color-light'
              className='second-button mr-4'
              type='submit'
              onClick={"submit"}
            >
              <i class='fa-sharp fa-solid fa-magnifying-glass'></i>
            </Button>

            <Button className='button'>Get in Touch</Button>
          </Col>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
export default NavbarOne;
